VALUES ('3512690002204', 'Poulet Tandoori Riz Basmati', 'Emincés de filets de poulet Halal cuisinés avec une sauce mijotée à la crème fraîche, aux oignons et aux épices Tandoori (53%) : _crème fraîche_ 41,3%, filets de poulet halal cuit standard 31,5% (filet de poulet halal 87%, eau, sel, _lactose_, sirop de glucose, stabilisants : E451 - E452, conservateur : E250, arômes (_soja_), saccharose, antioxydant : E301), oignons cuisinés 24,7% ; (oignons, huile de tournesol), épices tandoori 0,7% (épices et aromates contenant du _gluten_, de la _moutarde_ et des _sulfites_, sucres : saccharose - lactose, sel, colorants : poudre de betterave - oléorésine de paprika, maltodextrine, aciditiant : acide citrique, arôme, extraits d\'épices), sel, paprika, piment fort, acidifiants : lactate de potassium et di-acétate de sodium. Riz Basmati cuisiné (47%) : eau, riz Basmati, huile de tournesol, sel.', 'https://static.openfoodfacts.org/images/products/351/269/000/2204/front.6.400.jpg', '10.7', '5.7', '21.1', '2', '', '6.2', '0.78', '0.307086614173228', '', '1');

